syntax = "proto3";

package tech.utkorsho.protobuf.questionexam.message.questionDetail;

option java_multiple_files = true;

import "google/protobuf/wrappers.proto";

message PracticeExamQuestionDetailMessage {
  google.protobuf.StringValue id = 1;
  google.protobuf.StringValue questionText = 2;
}

message PracticeExamQuestionDetailListMessage {
  repeated PracticeExamQuestionDetailMessage questionDetails = 1;
}
